(num, gN, unit) =>  {
		let minus = '';
    if (num < 0) {
      minus = '-';
    }
    num = Math.abs(num);
    if (num > gN) {
      const newNum = (num / gN).toFixed(1);
      return `${minus}${newNum}${unit}`;
    } else {
      return `${minus}${num}`;
    }
	}

